import React, { useState } from 'react';
import { Form, Button, Container } from 'react-bootstrap';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import './ecommerce.css';

const AddProduct = () => {
  // State Hooks for Form Fields
  const [productName, setProductName] = useState('');
  const [barcode, setBarcode] = useState('');
  const [description, setDescription] = useState('');
  const [price, setPrice] = useState('');
  const [quantity, setQuantity] = useState('');
  const [category, setCategory] = useState('');
  const navigate = useNavigate();

  // Form Submission Handler
  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      // API request to add product
      await axios.post('/api/products', {
        name: productName,
        barcode,
        description,
        price,
        quantity,
        category,
      });
      alert('Product added successfully!');
      navigate('/view-products'); // Redirect after successful submission
    } catch (error) {
      console.error('Error adding product:', error);
      alert('Failed to add product.');
    }
  };

  // Render Form Component
  return (
    <Container className="add-container">
      <div className="add-floating-form">
        <h2 className="add-form-heading">Add Product</h2>
        <Form onSubmit={handleSubmit}>
          {/* Product Name Field */}
          <Form.Group controlId="productName">
            <Form.Label className="add-form-label">Product Name</Form.Label>
            <Form.Control
              type="text"
              placeholder="Enter product name"
              value={productName}
              onChange={(e) => setProductName(e.target.value)}
              required
              className="add-form-control"
            />
          </Form.Group>

          {/* Barcode Field */}
          <Form.Group controlId="barcode">
            <Form.Label className="add-form-label">Barcode</Form.Label>
            <Form.Control
              type="text"
              placeholder="Enter barcode"
              value={barcode}
              onChange={(e) => setBarcode(e.target.value)}
              required
              className="add-form-control"
            />
          </Form.Group>

          {/* Description Field */}
          <Form.Group controlId="description">
            <Form.Label className="add-form-label">Description</Form.Label>
            <Form.Control
              as="textarea"
              placeholder="Enter description"
              value={description}
              onChange={(e) => setDescription(e.target.value)}
              required
              className="add-form-control"
            />
          </Form.Group>

          {/* Price Field */}
          <Form.Group controlId="price">
            <Form.Label className="add-form-label">Price</Form.Label>
            <Form.Control
              type="number"
              placeholder="Enter price"
              value={price}
              onChange={(e) => setPrice(e.target.value)}
              required
              className="add-form-control"
            />
          </Form.Group>

          {/* Quantity Field */}
          <Form.Group controlId="quantity">
            <Form.Label className="add-form-label">Quantity</Form.Label>
            <Form.Control
              type="number"
              placeholder="Enter quantity"
              value={quantity}
              onChange={(e) => setQuantity(e.target.value)}
              required
              className="add-form-control"
            />
          </Form.Group>

          {/* Category Field */}
          <Form.Group controlId="category">
            <Form.Label className="add-form-label">Category</Form.Label>
            <Form.Control
              type="text"
              placeholder="Enter category"
              value={category}
              onChange={(e) => setCategory(e.target.value)}
              required
              className="add-form-control"
            />
          </Form.Group>

          {/* Submit Button */}
          <Button variant="primary" type="submit" className="add-submit-btn">
            Add Product
          </Button>
        </Form>
      </div>
    </Container>
  );
};

export default AddProduct;
